import React from 'react';
import { Container, Flex, Box, Heading } from 'rebass';

const Dashboard = () => {
  return (
    <Container>
      <Flex>
        <Box>
          <Heading>Welcome!</Heading>
        </Box>
      </Flex>
    </Container>
  );
};

export default Dashboard;
